INSERT INTO `administrador_publicacion` VALUES (1,'publicaciones/unnamed.jpg','Encuesta de Evaluación del Desempeño Docente 2014','El Departamento de Desarrollo Académico convoca a los estudiantes inscritos en el periodo agosto – diciembre 2014 a hacer la evaluación docente','<p>El Departamento de Desarrollo Acad&eacute;mico convoca a los estudiantes inscritos en el periodo agosto &ndash; diciembre 2014 a hacer la evaluaci&oacute;n docente para este per&iacute;odo. El enlace estar&aacute; abierto del 10 de noviembre al 8 de diciembre del 2014. Recuerda que responder la encuesta es requisito obligatorio para tu pr&oacute;xima reinscripci&oacute;n.</p>\r\n','2014-11-11','2014-11-10 22:59:20',NULL,0,1,1,1),(3,'publicaciones/2009-usa-flag-graphics.jpg','Inglés intensivo convocatoria','La division de estudios profesionales oferta cursos intensivos de ingles 2014 nivel III y IV','<p>La Divisi&oacute;n de Estudios Profesionales oferta los cursos de ingl&eacute;s de los siguientes niveles:</p>\r\n\r\n<p>Cursos de ingl&eacute;s intensivo 2014 Nivel III Nivel IV Del 18 de Noviembre al 15 de Diciembre de 2014</p>\r\n\r\n<p>Lunes a viernes de las 15:00 a las 18:00 horas</p>\r\n\r\n<p><strong>NOTA</strong>: La generaci&oacute;n de cursos a ofertar est&aacute; sujeto a la capacidad l&iacute;mite de 15 a 25 estudiantes.</p>\r\n\r\n<p><strong>Los cursos de los niveles tendr&aacute;n un costo de $500.00. </strong></p>\r\n\r\n<p><strong>Depositar en el banco Banorte,</strong></p>\r\n\r\n<p><strong>No. de empresa 37333</strong></p>\r\n\r\n<p><strong>Referencia bancaria E003CRINGLES2. </strong></p>\r\n\r\n<p>A partir de esta convocatoria ya no se ofertar&aacute; el nivel I y II Los cursos de niveles III y IV de manera paulatina entrar&aacute;n en proceso de liquidaci&oacute;n. Los ex&aacute;menes globales de ingl&eacute;s se continuar&aacute;n aplicando el &uacute;ltimo viernes de cada mes previa convocatoria.</p>\r\n','2014-11-11','2014-11-10 01:00:00',NULL,1,1,1,1),(4,'publicaciones/dsc_0002.jpg','Convocatoria para proveedores','Convocatoria pública y abierta para proveedores, para la compra de butacas de metal con paleta de poliestireno, bajo el procedimiento de invitacinón a','<p>Convocatoria p&uacute;blica y abierta para proveedores, para la compra de butacas de metal con paleta de poliestireno, bajo el procedimiento de invitacin&oacute;n a cuando menos tres personas, para el Instituto Tecnol&oacute;gico de Acapulco.</p>\r\n\r\n<p>Cualquier duda o aclaraci&oacute;n deber&aacute;n hacerlas llegar al siguiente correo electr&oacute;nico: ita_itp_004_14@it-acapulco.edu.mx</p>\r\n\r\n<p>Atentamente Departamento de Recursos Materiales.</p>\r\n','2014-11-11','2014-11-11 03:14:20',NULL,0,1,1,1),(5,'publicaciones/14.jpg','Convocatoria nuevo ingreso','CONVOCATORIA A todos los aspirantes al ciclo escolar Enero – Julio 2015 se les informa que se abre el nuevo periodo de entrega de fichas.','<p>A todos los aspirantes al ciclo escolar Enero &ndash; Julio 2015 se les informa que se abre el nuevo periodo de entrega de fichas para las carreras de:</p>\r\n\r\n<ul>\r\n	<li>Arquitectura</li>\r\n	<li>Ingenier&iacute;a Bioqu&iacute;mica</li>\r\n	<li>Ingenier&iacute;a Electromec&aacute;nica</li>\r\n	<li>Ingenier&iacute;a en Sistemas Computacionales</li>\r\n</ul>\r\n\r\n<p>Entrega de fichas Del 18 al 28 de Noviembre de 2014</p>\r\n\r\n<p>Cubrir el costo de la ficha $ 975.00</p>\r\n\r\n<p>Banco: Banorte</p>\r\n\r\n<p>No. de empresa: 37333</p>\r\n\r\n<p>No. de referencia: F009FICHAS140</p>\r\n\r\n<p>Las fichas se entregar&aacute;n en el Departamento de Servicios Escolares en un horario de 11:00 a 13:00 horas con los siguientes requisitos: El aspirante deber&aacute; cubrir la cuota por concepto de ficha, debe pagar primero en el banco y posteriormente debe canjear la ficha de dep&oacute;sito que el banco emite, en el departamento de recursos financieros del Instituto Tecnol&oacute;gico de Acapulco, por el recibo de pago oficial.</p>\r\n','2014-11-11','2014-11-11 03:14:20',NULL,0,1,1,1),(6,'publicaciones/delegaciones-imss.jpg','Inscripción al IMSS','Alumnos que llenaron el formato de inscripción al servicio medico del IMSS, pasar a la oficina de Servicios estudiantiles a recogerlo.','<p>Por este medio se les avisa a aquellos alumnos que llenaron su formato para inscripci&oacute;n al servicio m&eacute;dico por parte del IMSS, pasen a la Oficina de Servicios Estudiantiles a recoger dicho formato.</p>\r\n\r\n<p>Con este formato deber&aacute;n asistir a sus unidades m&eacute;dicas con dos fotograf&iacute;as, comprobante de domicilio, credencial de la escuela o del IFE y la CURP, para que se les proporcione su carnet. Es importante se&ntilde;alar que el carnet es requisito para el proceso de reinscripci&oacute;n, ya que sin &eacute;l no podr&aacute;n seleccionar materias. Atentamente Departamento de Servicios Escolares.</p>\r\n','2014-11-11','2014-11-11 03:14:20',NULL,0,1,1,1),(7,'publicaciones/8064bc4c1138ec43a51fefa482cfffcc20140520023358.jpg','Curso linux','ITA te ofrece el diplomado de Instalación, configuración y manejo de software libre\". ¡No dejes pasar la oportunidad! Horario sabatino','<p>INSTITUTO TECNOL&Oacute;GICO DE ACAPULCO</p>\r\n\r\n<p>Ofrece el diplomado titulado: INSTALACI&Oacute;N, CONFIGURACI&Oacute;N Y MANEJO DE SOFTWARE LIBRE. &iexcl;No dejes pasar la oportunidad! &iexcl;Horario sabatino! Instructor: Ing. Daniel Enrique V&aacute;zquez Sol&iacute;s 4 M&oacute;dulos de 40 horas, con un total de 160 horas. Costo: 1,450.00 por m&oacute;dulo Inscripciones: Octubre/2014 a Enero/2015 Mayores informes: Tel. 4429010 Ext. 148 &oacute; 142 O al correo del instructor: geniux_aca@yahoo.com.mx</p>\r\n','2014-11-10','2010-11-11 03:14:20',NULL,1,1,1,1),(8,'publicaciones/slider_fese.jpg','Convocatoria FESE','¿Eres egresado 2014 y quieres emplearte?, ¡participa en la convocatoria de la FESE para egresados de carreras acreditadas! Fecha limite 18/Nov/2014','<p>&iquest;Eres egresado 2014 y quieres emplearte?,</p>\r\n\r\n<p>&iexcl;participa en la convocatoria de la FESE para egresados de carreras acreditadas! Fecha limite 18/Nov/2014</p>\r\n\r\n<p>FUNDACI&Oacute;N EDUCACI&Oacute;N SUPERIOR-EMPRESA EJE ESTRAT&Eacute;GICO DE APOYO A LA INSERCI&Oacute;N LABORAL</p>\r\n\r\n<p>Considerando que los alumnos al terminar sus estudios de educaci&oacute;n superior requieren fortalecer competencias espec&iacute;ficas que exige el mercado laboral para la obtenci&oacute;n de su primer empleo, la Fundaci&oacute;n Educaci&oacute;n Superior Empresa (FESE) instrumenta en el marco de su Eje Estrat&eacute;gico de Apoyo a la Inserci&oacute;n Laboral, el Programa FESE Empl&eacute;ate&reg;, con el objeto de fomentar la empleabilidad de los reci&eacute;n egresados; por lo que, CONVOCA A las instituciones de educaci&oacute;n superior p&uacute;blicas a proponer a sus reci&eacute;n egresados de las carreras de nivel licenciatura, as&iacute; como a las empresas vinculadas, para las candidaturas de participaci&oacute;n en el Programa a fin de fortalecer su formaci&oacute;n profesional y facilitar su incorporaci&oacute;n en el mercado laboral para la obtenci&oacute;n de un apoyo econ&oacute;mico por un monto de $6,000.00 (Seis mil pesos 00/100 M.N.) mensuales durante seis meses (duraci&oacute;n del Programa), cantidad que ser&aacute; aportada por la FESE y con el apoyo de las empresas participantes.</p>\r\n','2014-11-11','2014-11-11 04:00:07',NULL,1,1,1,1),(16,'publicaciones/Enrique_VIII_y_sus_6_esposas_6ccTHPE.png','Enrique VIII de Inglaterra','Enrique VIII (28 de junio de 1491 – 28 de enero de 1547) fue rey de Inglaterra y señor de Irlanda desde el 22 de abril de 1509 hasta su muerte.','<p>Enrique VIII (28 de junio de 1491 &ndash; 28 de enero de 1547) fue rey de Inglaterra y se&ntilde;or de Irlanda desde el 22 de abril de 1509 hasta su muerte. Fue el segundo monarca de la casa Tudor, heredero de su padre, Enrique VII. Se cas&oacute; seis veces y ejerci&oacute; el poder m&aacute;s absoluto entre todos los monarcas ingleses. Entre los hechos m&aacute;s notables de su reinado se incluyen la ruptura con la Iglesia cat&oacute;lica romana y el establecimiento del monarca como jefe supremo de la Iglesia de Inglaterra (Iglesia anglicana), la disoluci&oacute;n de los monasterios y la uni&oacute;n de Inglaterra con Gales.</p>\r\n\r\n<p>Tambi&eacute;n promulg&oacute; legislaciones importantes, como las varias actas de separaci&oacute;n con la Iglesia de Roma,2 de su designaci&oacute;n como cabeza suprema de la Iglesia de Inglaterra, las Union Acts de 1535 y 1542, que unificaron a Inglaterra y Gales como una sola naci&oacute;n, la Buggery Act de 1533, primera legislaci&oacute;n contra la sodom&iacute;a en Inglaterra y la Witchcraft Act de 1542, que castigaba con la muerte la brujer&iacute;a.3 La protecci&oacute;n que dispens&oacute; al pintor alem&aacute;n Hans Holbein se tradujo en una formidable serie de retratos y dibujos en color, que efigian a muchos personajes de la corte de aquella &eacute;poca. Destaca la efigie del propio Enrique VIII, en el Museo Thyssen-Bornemisza. Primeros a&ntilde;os Escudo de Enrique como Pr&iacute;ncipe de Gales Enrique naci&oacute; en el palacio de Placentia en Greenwich el 28 de junio de 1491. Fue el tercer hijo de Enrique VII e Isabel de York.</p>\r\n\r\n<p>S&oacute;lo tres de sus seis hermanos sobrevivieron a la infancia: Arturo, pr&iacute;ncipe de Gales, Margarita y Mar&iacute;a, futura reina consorte de Francia. Su padre, miembro de la Casa de Lancaster, hab&iacute;a adquirido el trono por derecho de conquista, ya que su ej&eacute;rcito derrot&oacute; al &uacute;ltimo Plantagenet, Ricardo III, y posteriormente complet&oacute; sus derechos desposando a Isabel, hija de Eduardo IV de Inglaterra. En 1493, Enrique fue designado condestable4 del castillo de Dover y Lord Warden de los cinco puertos. En 1494 fue nombrado Duque de York y posteriormente Conde Mariscal de Inglaterra y Lord teniente de Irlanda. Enrique recibi&oacute; una educaci&oacute;n de primera clase de importantes tutores y consigui&oacute; adquirir fluidez en lat&iacute;n, franc&eacute;s y espa&ntilde;ol.</p>\r\n\r\n<p>Su madre falleci&oacute; cuando &eacute;l ten&iacute;a once a&ntilde;os. Durante su juventud fue un &aacute;vido apostador y jugador de dados y tambi&eacute;n practic&oacute; justas, caza y royal tennis, antepasado del actual tenis. Fue adem&aacute;s un m&uacute;sico completo, escritor y poeta. Se involucr&oacute; en la reconstrucci&oacute;n y mejoramiento de varios edificios importantes, como el Palacio Nonsuch, la capilla del King&#39;s College en Cambridge, y la Abad&iacute;a de Westminster en Londres. En muchos casos se trataba de edificios confiscados, por ejemplo al Cardenal Thomas Wolsey, entre ellos Christ Church en Oxford, el palacio de Hampton Court, el palacio de Whitehall y el Trinity College en Cambridge.</p>\r\n','2014-11-12','2014-11-10 19:26:41',NULL,1,1,1,1),(17,'publicaciones/RegresoClase-55.jpg','Atento y urgente aviso a la comunidad tecnológica',' Se informa a la Comunidad Tecnológica que el día de mañana sábado 15 de noviembre del 2014 se reanudan en forma normal las labores.','<p>ATENTO Y URGENTE AVISO A LA COMUNIDAD TECNOL&Oacute;GICA Se informa a la Comunidad Tecnol&oacute;gica que el d&iacute;a de ma&ntilde;ana s&aacute;bado 15 de noviembre del 2014 se reanudan en forma normal las labores acad&eacute;micas, extra-escolares y administrativas que correspondan, una vez que se han dado las condiciones y acuerdos necesarios. ATENTAMENTE: LA ADMINISTRACI&Oacute;N</p>\r\n','2014-11-14','2014-11-14 19:09:11',NULL,1,1,1,1),(18,'publicaciones/_DSC8279.JPG','Examenes Especiales','Examenes Especiales en el Tecnológico de Acapuflco es el proximo semestre, Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod','<p>Examenes Especiales en el Tecnol&oacute;gico de Acapuflco es el proximo semestre, Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>\r\n','2014-11-29','2014-11-29 18:04:49',NULL,1,1,5,1),(19,'publicaciones/In_Honor_of_the_Maharajah_by_MaidenFayth.jpg','Indian Elephant','The Indian elephant (Elephas maximus indicus) is one of three recognized subspecies of the Asian elephant and native to mainland Asia.','<p>The Indian elephant (Elephas maximus indicus) is one of three recognized subspecies of the Asian elephant and native to mainland Asia. Since 1986, Elephas maximus has been listed as Endangered by IUCN as the population has declined by at least 50% over the last 60 to 75 years or three generations. Asian elephants are threatened by habitat loss, degradation and fragmentation.</p>\r\n\r\n<h3>CHARACTERISTICS</h3>\r\n\r\n<p>In general, Asian elephants are smaller than African elephants and have the highest body point on the head. The tip of their trunk has one finger-like process. Their back is convex or level.[2] Indian elephants reach a shoulder height of between 2 and 3.5 m (6.6 and 11.5 ft), weigh between 2,000 and 5,000 kg (4,400 and 11,000 lb), and have 19 pairs of ribs. Their skin color is lighter than of maximus with smaller patches of depigmentation, but darker than of sumatranus. Females are usually smaller than males, and have short or no tusks.</p>\r\n\r\n<p>&nbsp;The largest Indian elephant was 3.43 metres (11.3 ft) high at the shoulder.&nbsp;In 1985, two large elephant bulls were spotted for the first time in Bardia National Park, and named Raja Gaj and Kanchha. They roamed the park area together and made occasional visits to the females. Raja Gaj stood 11.3 ft (3.4 m) tall at the shoulder and had a massive body weight. His appearance has been compared to that of a mammoth due to his high bi-domed shaped head. His forehead and domes were more prominent than in other Asian bull elephants.[5] Indian elephants have smaller ears, but relatively broader skulls and larger trunks than African elephants.</p>\r\n\r\n<p>Toes are large and broad. Unlike their African cousins, their abdomen is proportionate with their body weight but the African elephant has a large abdomen as compared to the skulls.</p>\r\n\r\n<h3>ECOLOGY AND BEHAVIOUR</h3>\r\n\r\n<p>Elephants are classified as megaherbivores and consume up to 150 kg (330 lb) of plant matter per day.[8] They are generalist feeders, and both grazers and browsers. In a study area of 1,130 km2 (440 sq mi) in southern India, elephants were recorded to feed on 112 different plant species, most commonly of the order Malvales, and the legume, palm, sedge and true grass families. They graze on the tall grasses, but the portion consumed varies with season. When the new flush appears in April, they remove the tender blades in small clumps. Later, when grasses are higher than 0.5 m (1.6 ft), they uproot entire clumps, dust them skilfully and consume the fresh leave tops, but discard the roots. When grasses are mature in autumn, they clean and consume the succulent basal portions with the roots, and discard the fibrous blades. From the bamboos, they eat seedlings, culms and lateral shoots. During the dry season from January to April, they mainly browse on both leaves and twigs preferring the fresh foliage, and consume thorn bearing shoots of acacia species without any obvious discomfort.</p>\r\n\r\n<p>They feed on the bark of white thorn and other flowering plants, and consume the fruits of wood apple, tamarind, kumbhi and date palm.[9] In Nepal&#39;s Bardia National Park, elephants consume large amounts of the floodplain grass, particularly during the monsoon season. They browse more in the dry season with bark constituting a major part of their diet in the cool part of that season.[10] During a study in a tropical moist mixed deciduous forested area of 160 km2 (62 sq mi) in Assam, elephants were observed to feed on about 20 species of grasses, plants and trees. Grasses such as Imperata cylindrica and Leersia hexandra constituted by far the most predominant component of their diet.</p>\r\n','2014-12-07','2014-12-08 04:04:33',NULL,1,1,1,2),(20,'publicaciones/placeholder_8asve3i.jpg','Revisión de retícula.','Se informa que el proceso de revisión de retícula se llevara a cabo a partir de la semana del 08 de Diciembre de 2014','<p>Se informa que el proceso de revisi&oacute;n de ret&iacute;cula se llevara a cabo a partir de la semana del 08 de Diciembre de 2014, para las carreras de Arquitectura, Ingenier&iacute;a Electromec&aacute;nica, Ingenier&iacute;a Bioqu&iacute;mica, Ingenier&iacute;a en Sistemas Computacionales y Licenciatura en Administraci&oacute;n, posteriormente se programaran las carreras restantes.</p>\r\n','2014-12-09','2014-12-09 14:21:19','2014-12-13 03:00:00',1,1,1,1),(21,'publicaciones/placeholder_ZCZwO6N.jpg','Convocatoría nuevo ingreso','A todos los aspirantes al ciclo escolar Agosto – Diciembre 2014 se les informa que se   abre el nuevo periodo de entrega de fichas','<p>A todos los aspirantes al ciclo escolar Agosto &ndash; Diciembre 2014 se les informa que se&nbsp;abre el nuevo periodo de entrega de fichas:</p>\r\n\r\n<ul>\r\n	<li>Arquitectura</li>\r\n	<li>Ingenier&iacute;a Bioqu&iacute;mica</li>\r\n	<li>Ingenier&iacute;a Electromec&aacute;nica</li>\r\n	<li>Ingenier&iacute;a en Gesti&oacute;n Empresarial</li>\r\n	<li>Ingenier&iacute;a en Sistemas Computacionales</li>\r\n	<li>Licenciatura en Administraci&oacute;n</li>\r\n	<li>Contador P&uacute;blico</li>\r\n</ul>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>El aspirante deber&aacute; cubrir la cuota por concepto de ficha, debe pagar primero en el banco y posteriormente debe canjear la&nbsp;ficha de dep&oacute;sito que el banco emite, en el departamento de recursos financieros del Instituto Tecnol&oacute;gico de Acapulco, por el&nbsp;recibo de pago oficial.</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>El aspirante deber&aacute; cubrir la cuota por concepto de ficha, debe pagar primero en el banco y posteriormente debe canjear la&nbsp;ficha de dep&oacute;sito que el banco emite, en el departamento de recursos financieros del Instituto Tecnol&oacute;gico de Acapulco, por el&nbsp;recibo de pago oficial.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>El aspirante deber&aacute; cubrir la cuota por concepto de ficha, debe pagar primero en el banco y posteriormente debe canjear la&nbsp;ficha de dep&oacute;sito que el banco emite, en el departamento de recursos financieros del Instituto Tecnol&oacute;gico de Acapulco, por el&nbsp;recibo de pago oficial.</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Cubrir el costo de la ficha <strong>$ 975.00</strong>Entrega de fichas Del <strong>06 al 31 de Mayo de 2014</strong></p>\r\n\r\n<p>Banco: <a href=\"http://banorte.com\"><strong>Banorte</strong></a></p>\r\n\r\n<p>No. de empresa: <strong>37333</strong></p>\r\n\r\n<p>No. de referencia: <strong>F009FICHAS140</strong></p>\r\n\r\n<p><strong>Las fichas se entregar&aacute;n en el Departamento de Servicios Escolares en un horario de 10:00 a 13:00 horas&nbsp;con los siguientes requisitos:</strong></p>\r\n\r\n<p>El aspirante deber&aacute; cubrir la cuota por concepto de ficha, debe pagar primero en el banco y posteriormente debe canjear la&nbsp;ficha de dep&oacute;sito que el banco emite, en el departamento de recursos financieros del Instituto Tecnol&oacute;gico de Acapulco, por el&nbsp;recibo de pago oficial.</p>\r\n\r\n<p><strong>Requisitos</strong>: El aspirante debe preparar la siguiente documentaci&oacute;n, en original y copia fotost&aacute;tica</p>\r\n\r\n<ol>\r\n	<li>Certificado de bachillerato o historial acad&eacute;mico hasta el quinto semestre sin materias reprobadas.</li>\r\n	<li>Acta de nacimiento (formato nuevo).</li>\r\n	<li>Identificaci&oacute;n oficial o credencial de la Instituci&oacute;n educativa de procedencia.</li>\r\n	<li>Dos fotograf&iacute;as en blanco y negro tama&ntilde;o infantil</li>\r\n	<li>CURP (ampliada al 200%)</li>\r\n	<li>Recibo de pago oficial de la Instituci&oacute;n por concepto de ficha</li>\r\n</ol>\r\n\r\n<p><strong>Nota</strong>: La carrera seleccionada en la ficha del I.T.A. deber&aacute; coincidir con la seleccionada en el pase de&nbsp;CENEVAL.</p>\r\n\r\n<p>Fecha de aplicaci&oacute;n del examen: Viernes 06 de Junio de 2014.</p>\r\n\r\n<p>Hora de aplicaci&oacute;n: 09:00 a las 13:30 Hrs.</p>\r\n','2014-12-10','2014-12-10 22:01:58','2014-12-13 16:18:00',1,1,1,1);
